import React, { Component } from 'react'


export class Audi extends Component {

    state = {
        carsAudi: []
    }

    componentDidMoun() {
        fetch('./Data/cars.json').then(response => {
            console.log(response);
            return response.json();
        }).then(data => {
            // Work with JSON data here
            console.log(data);
        }).catch(err => {
            // Do something for an error here
            console.log("Error Reading data " + err);
        });
    }

    render() {
        return (
            <div>
                <div className="container mt-5 pt-5">
                    <div className="row">
                        <img className="col-lg-3 img-show-side" src="\Images\Logos\cmp\audi.png" alt="audi" /><div className="col-lg-9">Mercedes</div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Audi
